import React from 'react';
import logo from './logo.svg';
import './App.css';
import Dashboard from './dashboard';
import Balaji from './balaji';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Dashboard />
       <Balaji/>
      </header>

    </div>
  );
}

export default App;
